    def Show_Add_Table(self):
            self.sqliteConnection = sqlite3.connect('all_products.db')
            self.cursor = self.sqliteConnection.cursor()
            self.cursor.execute("""SELECT * FROM pc""")
            self.data = self.cursor.fetchall()

            if self.data:
                    self.table_all_pc.insertRow(0)
                    for row, form in enumerate(self.data):
                            for column, item in enumerate(form):
                                    self.table_all_pc.setItem(row, column, QTableWidgetItem(str(item)))
                                    column += 1
                            row_position = self.table_all_pc.rowCount()
                            self.table_all_pc.insertRow(row_position)
    def Show_User_Table(self):
            self.sqliteConnection = sqlite3.connect('users.db')
            self.cursor = self.sqliteConnection.cursor()
            self.cursor.execute("""SELECT * FROM clients""")
            self.data = self.cursor.fetchall()

            if self.data:
                    self.table_all_cilent.insertRow(0)
                    for row, form in enumerate(self.data):
                            for column, item in enumerate(form):
                                    self.table_all_cilent.setItem(row, column, QTableWidgetItem(str(item)))
                                    column += 1
                            row_position = self.table_all_cilent.rowCount()
                            self.table_all_cilent.insertRow(row_position)
